import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './options.css';

const Options=()=>{
    return(
        <Fragment>
            <div className="options_container">
            <div className="option">
                <div className='option_list'>Home</div>
                <div className='option_list'>Resources</div>
                <div className='option_list'>Skills</div>
                <div className='option_list'>About Me</div>
                </div>
                <div className="underline"></div>
            </div>
        </Fragment>
    );
};

export default Options;
